import React from "react";
// import { useState } from "react";
import { useNavigate } from "react-router-dom";
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

export default function LoginAuthPage({ onClickButton, signButton }) {

    const notify = () =>{
        toast.success('Succesfully logined', {
            position: "bottom-right",
            autoClose: 5000,
            hideProgressBar: false,
            closeOnClick: true,
            pauseOnHover: true,
            draggable: true,
            progress: undefined,
            theme: "light",
            transition: Bounce,
            });
    }
    const navigate = useNavigate();
    const handleSignUp =()=>{
        signButton()
        navigate('/signup')
        notify()
    }

    return (
        <>
        <div className="login-auth-detail-container">
            <div className="login-auth-container-header">
            <div className="login-auth-login-name">Login</div>
            <div
                className="login-auth-container-close-button"
                onClick={onClickButton}
            >
                <svg
                xmlns="http://www.w3.org/2000/svg"
                viewBox="0 0 24 24"
                fill="currentColor"
                >
                <path d="M11.9997 10.5865L16.9495 5.63672L18.3637 7.05093L13.4139 12.0007L18.3637 16.9504L16.9495 18.3646L11.9997 13.4149L7.04996 18.3646L5.63574 16.9504L10.5855 12.0007L5.63574 7.05093L7.04996 5.63672L11.9997 10.5865Z"></path>
                </svg>
            </div>
            </div>
            <div className="login-auth-container-body">
                <form className="login-auth-email-pass-container">
                <input
                    type="text"
                    placeholder="Email"
                    className="login-auth-body-email"
                />
                <input
                    type="password"
                    placeholder="Password"
                    className="login-auth-body-email"
                />
                </form>
                <button className="login-auth-body-button">LOGIN</button>
            </div>
            <div className="login-auth-container-signUp">
            Dont have an Account?&nbsp;&nbsp;{" "}
            <button
                onClick={handleSignUp}
                style={{
                color: "white",
                textDecoration: "underline",
                background: "transparent",
                border: "none",
                cursor: "pointer",
                }}
            >
                Sign Up
            </button>
            <ToastContainer
            />
            </div>
        </div>
        </>
    );
}
